const Users = ({ users }) => {
  return (
    <>
      <h3>Users</h3>
      <ul className="list-group">
        {users.map(user => {
          return (
            <li key={user.id} className="list-group-item list-group-item-action d-flex justify-content-between align-content-center">
            <img src={user.avatar} alt="" style={{borderRadius: '50%'}}/>
              <div>
                <strong>{user.first_name} {user.last_name}</strong>
                <p>Email: {user.email}</p>
              </div>
            </li>
          );
        })}
      </ul>
    </>
  );
}

export default Users;
